    "Atmospheric Aerosol Analysis using Lightweight Mini GC Project",nt"tracking_summary":
    {ntt"total": 8,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T00:47:54.307041",nt"name": "atmospheric-aerosol-analysis-using-lightweight-mini-gc-project-6ba9a",nt"isopen":
    true,nt"url": null,nt"notes": "The major components of manmade aerosols
    are created by the burning of coal and oil.  Aerosols are recognized to significantly
    impact the climate through their effects on solar and terrestrial radiation.  Accurate
    speciation and measurement of aerosol composition is an important first step in
    understanding and managing these pollutants. This Phase II proposal continues development
    of a small, portable, detection system specifically for the collection, speciation
    and identification of gas phase and aerosolized organics. This Mini Gas Chromatograph
    collects samples and operates without the need for compressed-bottled gas by using
    Seacoast's proprietary chemicapacitive sensor array and commercial sensors with
    a preconcentration/chromatography system, combining selectivity from a diverse sensor
    array with a miniature sampling system for amplified sensitivity. Specific components
    are: 1) sample preconcentrator/collector capable of being heated quickly, 2) capillary
    column to separate the chemicals released from the preconcentrator and provide selectivity,
    3) the chemical sensor array containing Seacoast's chemoselective microcapacitors
    and metal-oxide-based detectors, 4) integrated user interface. In Phase I Seacoast
    demonstrated that the system is capable of analyzing gas-phase and aerosolized volatile
    organics. In Phase II we propose to further develop the system's capabilities with
    a focus on improving sensitivity and collection efficiency.  ",nt"license_title":
